let o = parcel.getFeatureById('cross')
let x = parcel.getFeatureById('cross')

let clones = []
let nought = true

feature.on('click', e => {
  if (clones.length === 9) {
    clones.forEach(c => c.remove())
    clones = []
  }

  let c = (nought ? o : x).clone()
  c.position.copyFrom(e.point)
  clones.push(c)

  nought = !nought
})

